import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import "../welcome/Slick.css";
// import week_1_pregnant from "../images/slick/slick1.jpg";
// import slick2 from "../images/slick/slick2.jpg";
// import slick3 from "../images/slick/slick3.jpg";
// import slick4 from "../images/slick/slick4.jpg";
// import slick5 from "../images/slick/slick5.jpg";
// import slick6 from "../images/slick/slick6.jpg";

export default class CenterMode extends Component {
    render() {
      const settings = {
        dots: true,
        infinite: true,
        slidesToShow: 3,
        slidesToScroll: 1,
        autoplay: true,
        speed: 2000,
        autoplaySpeed: 2000,
        cssEase: "linear"
      };
      return (
        <div>
          <Slider {...settings}>

            <div>
            <img src="../images/Pregnancy by week/1-week-pregnant.png" alt="logo" width="200" height="200"/>
            </div>
            <div>
            <img src="../images/Pregnancy by week/1-week-pregnant.png" alt="logo" width="200" height="200"/>
            </div>
            <div>
            <img src="../images/Pregnancy by week/1-week-pregnant.png" alt="logo" width="200" height="200"/>
            </div>
            <div>
            <img src="../images/Pregnancy by week/1-week-pregnant.png" alt="logo" width="200" height="200"/>
            </div>
            <div>
            <img src="../images/Pregnancy by week/1-week-pregnant.png" alt="logo" width="200" height="200"/>
            </div>
          </Slider>
        </div>
      );
    }
  }
